import React from "react";
import Home from "./Home"
class App extends React.Component {

  constructor(){
    super();
    console.log("constructor called")
  }
  render() {
    console.log("render called")
    return (
      <>
      <p><button onClick={this.incrementCount}>+</button>{this.state.count}<button onClick={this.decrementCount}>-</button></p>
      <Home />
      </> 
    )
  }
}
export default App;
